import React from "react";
import DashboardMenuItem from "./DashboardMenuItem";
import axios from "axios";


export default function DashboardSideNav(props){
    let dashboards = ["Main"];
    const menu = [];
    useEffect(()=>{

            async function fetchStockPrice(ticker) {
                let requestString = 'https://sandbox.iexapis.com/stable/stock/' + ticker + '/price?token=Tsk_b7a45cc65e624a55a5688d15eac1b692';
                let myJson = await axios.get(requestString);
                return await myJson.data;
            }

            fetchStockPrice(props.symbol).then(result => setPrice(result));

    },[]);

    for (const [index, value] of dashboards.entries()) {
        menu.push(<DashboardMenuItem name={value}/>)
    }
    return(
        <div>
            {menu}
        </div>

    )




}
